import "./App.css";
import Header from "./components/Header.js";
import Swap from "./components/Swap.js";
import Token from "./components/Tokens.js";
import {Routes, Route} from "react-router-dom"

function App() {
  return (
  <div className="App">
    <Header />
    <Routes>
      <Route path = "/"></Route>
    </Routes>
  </div>
  );
}

export default App;
